	if (canPhase) this.canPhase(to, this.getInverseIndex(to));
	if (canClone)	this.getSpawnCells(to);

	//if not a continued move, change player
	if(!this.moves[pi].length) this.switchPlayer();
	else {this.continuedMove = to;/*debugger;*/}

	return false;
}

