	return (BOARD_AREA - 1) - index;
}

Leap.prototype.getConfig = () => ({
  'BOARD_SIZE': BOARD_SIZE,
  'BOARD_AREA': BOARD_AREA,
  'BIT_SIZE': BIT_SIZE,
});

